import React from 'react';

export default function Bug( {bug, toggleBug} ){

	function handleBugClick() {
		toggleBug(bug.id);
	}
	return (
	<div>
		<label>
			<input type="checkbox" checked={bug.complete} onChange={handleBugClick} />
			{bug.name}
		</label>
	</div>
	);
}
